import React from "react";
import "./button.scss";

const Button = ({ buttonLink, label, validation }) => {
  return (
    <button
      onClick={validation()}
      className={`button animation${buttonLink ? " button-link" : ""}`}
    >
      {label}
    </button>
  );
};

export default Button;
